import React, { Component } from 'react'
import Slider from "react-slick";


class Carousel extends Component {
    constructor(props) {
        super(props);
        this.state = { 

            settings:{
          dots: true,
          infinite: true,
          speed: 500,
          slidesToShow: 3,
          slidesToScroll: 1
          }
        
        }
    }
    render() { 
        let cards=[];
        return ( 
        <React.Fragment>
            <div className="row">
            <div className="col-md-12 p-3">
            <Slider {...this.state.settings}>
            <div className="cont_c">
                <div>
                <img src="" alt="" className="c_img"/>
                </div>
                <div className="title"></div>
                <div className="subti"></div>
                <div className="title"></div>
            </div>
                </Slider>
            </div>
            </div>
        </React.Fragment> 
        );
    }
}
 
export default Carousel;
